 buildViz = function (d3) {
    return function(widthInPixels = 800,
                      heightInPixels = 600,
                      max_snippets = null,
                      color = null,
                      sortByDist = true,
                      useFullDoc = false,
                      greyZeroScores = false,
                      chineseMode = false,
                      nonTextFeaturesMode = false,
                      showCharacteristic = true,
                      wordVecMaxPValue = false,
                      saveSvgButton = false,
                      reverseSortScoresForNotCategory = false,
                      minPVal=0.05) {
        var divName = 'd3-div-1';

        // Set the dimensions of the canvas / graph
        var margin = {top: 30, right: 20, bottom: 30, left: 50},
            width = widthInPixels - margin.left - margin.right,
            height = heightInPixels - margin.top - margin.bottom;

        // Set the ranges
        var x = d3.scaleLinear().range([0, width]);
        var y = d3.scaleLinear().range([height, 0]);

        function axisLabeler(d, i) {
            return ["Infrequent", "Average", "Frequent"][i]
        }

        var xAxis = d3.axisBottom(x).ticks(3).tickFormat(axisLabeler);

        var yAxis = d3.axisLeft(y).ticks(3).tickFormat(axisLabeler);

        // var label = d3.select("body").append("div")
        var label = d3.select('#' + divName).append("div")
            .attr("class", "label");

        // setup fill color
        //var color = d3.interpolateRdYlBu;
        if (color == null) {
            color = d3.interpolateRdYlBu;
        }
        ;

        // Adds the svg canvas
        // var svg = d3.select("body")
        svg = d3.select('#' + divName)
            .append("svg")
            .attr("width", width + margin.left + margin.right + 200)
            .attr("height", height + margin.top + margin.bottom)
            .append("g")
            .attr("transform",
                "translate(" + margin.left + "," + margin.top + ")");

        var lastCircleSelected = null;

        function deselectLastCircle() {
            if (lastCircleSelected) {
                lastCircleSelected.style["stroke"] = null;
                lastCircleSelected = null;
            }
        }

        function getSentenceBoundaries(text) {
            // !!! need to use spacy's sentence splitter
            if (chineseMode) {
                var sentenceRe = /\n/gmi;
            } else {
                var sentenceRe = /\(?[^\.\?\!\n\b]+[\n\.!\?]\)?/g;
            }
            var offsets = [];
            var match;
            while ((match = sentenceRe.exec(text)) != null) {
                offsets.push(match.index);
            }
            offsets.push(text.length);
            return offsets;
        }

        function getMatchingSnippet(text, boundaries, start, end) {
            var sentenceStart = null;
            var sentenceEnd = null;
            for (var i in boundaries) {
                var position = boundaries[i];
                if (position <= start && (sentenceStart == null || position > sentenceStart)) {
                    sentenceStart = position;
                }
                if (position >= end) {
                    sentenceEnd = position;
                    break;
                }
            }
            var snippet = (text.slice(sentenceStart, start) + "<b>" + text.slice(start, end)
            + "</b>" + text.slice(end, sentenceEnd)).trim();
            if (sentenceStart == null) {
                sentenceStart = 0;
            }
            return {'snippet': snippet, 'sentenceStart': sentenceStart};
        }

        function gatherTermContexts(d) {
            var category_name = fullData['info']['category_name'];
            var not_category_name = fullData['info']['not_category_name'];
            var matches = [[], []];
            if (fullData.docs === undefined) return matches;
            if (!nonTextFeaturesMode) {
                return searchInText(d);
            } else {
                return searchInExtraFeatures(d);
            }
        }

        function searchInExtraFeatures(d) {
            var matches = [[], []];
            var term = d.term;
            for (var i in fullData.docs.extra) {

                if (term in fullData.docs.extra[i]) {
                    var strength = fullData.docs.extra[i][term] /
                        Object.values(fullData.docs.extra[i]).reduce(
                            function (a, b) {
                                return a + b
                            });
                    var text = fullData.docs.texts[i];
                    if (!useFullDoc)
                        text = text.slice(0, 300);
                    var curMatch = {'id': i, 'snippets': [text], 'strength': strength};

                    curMatch['meta'] = fullData.docs.meta[i];
                    matches[fullData.docs.labels[i]].push(curMatch);
                }
            }
            for (var i in [0, 1]) {
                matches[i] = matches[i].sort(function (a, b) {
                    return a.strength < b.strength ? 1 : -1
                })
            }
            return {'contexts': matches, 'info': d};
        }

        function searchInText(d) {
            function stripNonWordChars(term) {
                //d.term.replace(" ", "[^\\w]+")
            }

            function buildMatcher(term) {
                var boundary = '\\b';
                var wordSep = "[^\\w]+";
                if (chineseMode) {
                    boundary = '( |$|^)';
                    wordSep = ' ';
                }
                var regexp = new RegExp(boundary + '('
                    + term.replace(' ', wordSep, 'gim') + ')' + boundary, 'gim');
                try {
                    regexp.exec('X');
                } catch (err) {
                    console.log("Can't search " + term);
                    console.log(err);
                    return null;
                }
                return regexp;
            }

            var matches = [[], []];
            var pattern = buildMatcher(d.term);
            if (pattern !== null) {
                for (var i in fullData.docs.texts) {
                    if (fullData.docs.labels[i] > 1) continue;
                    var text = fullData.docs.texts[i];
                    //var pattern = new RegExp("\\b(" + stripNonWordChars(d.term) + ")\\b", "gim");
                    var match;
                    var sentenceOffsets = null;
                    var lastSentenceStart = null;
                    var matchFound = false;
                    var curMatch = {'id': i, 'snippets': []};
                    if (fullData.docs.meta) {
                        curMatch['meta'] = fullData.docs.meta[i];
                    }
                    while ((match = pattern.exec(text)) != null) {
                        if (sentenceOffsets == null) {
                            sentenceOffsets = getSentenceBoundaries(text);
                        }
                        var foundSnippet = getMatchingSnippet(text, sentenceOffsets,
                            match.index, pattern.lastIndex);
                        if (foundSnippet.sentenceStart == lastSentenceStart) continue; // ensure we don't duplicate sentences
                        lastSentenceStart = foundSnippet.sentenceStart;
                        curMatch.snippets.push(foundSnippet.snippet);
                        matchFound = true;
                    }
                    if (matchFound) {
                        if (useFullDoc) {
                            curMatch.snippets = [
                                text
                                    .replace(/\n$/g, '\n\n')
                                    .replace(
                                        //new RegExp("\\b(" + d.term.replace(" ", "[^\\w]+") + ")\\b",
                                        //    'gim'),
                                        pattern,
                                        '<b>$&</b>')
                            ];
                        }
                        matches[fullData.docs.labels[i]].push(curMatch);

                    }
                }
            }
            return {'contexts': matches, 'info': d};
        }

        function displayTermContexts(termInfo, jump=true) {
            var contexts = termInfo.contexts;
            var info = termInfo.info;
            if (contexts[0].length == 0 && contexts[1].length == 0) {
                return null;
            }
            //var categoryNames = [fullData.info.category_name,
            //    fullData.info.not_category_name];
            var catInternalName = fullData.info.category_internal_name;
            fullData.docs.categories
                .map(
                    function (catName, catIndex) {
                        if (max_snippets != null) {
                            var contextsToDisplay = contexts[catIndex].slice(0, max_snippets);
                        }
                        var divId = catName == catInternalName ? '#cat' : '#notcat';
                        var temp = d3.select(divId)
                            .selectAll("div").remove();
                        contexts[catIndex].forEach(function (context) {
                            var meta = context.meta ? context.meta : '&nbsp;';
                            d3.select(divId)
                                .append("div")
                                .attr('class', 'snippet_meta')
                                .html(meta);
                            context.snippets.forEach(function (snippet) {
                                d3.select(divId)
                                    .append("div")
                                    .attr('class', 'snippet')
                                    .html(snippet);
                            })

                        });
                    });
            d3.select('#termstats')
                .selectAll("div")
                .remove();
            d3.select('#termstats')
                .append('div')
                .attr("class", "snippet_header")
                .html('Term: <b>' + info.term + '</b>');
            var message = '';
            var cat_name = fullData.info.category_name;
            var ncat_name = fullData.info.not_category_name;

            function getFrequencyDescription(name, count25k, count) {
                var desc = name + ' frequency: <div class=text_subhead>' + count25k
                    + ' per 25,000 terms</div>';
                if (count == 0) {
                    desc += '<u>Not found in any ' + name + ' documents.</u>';
                } else {
                    desc += '<u>Some of the ' + count + ' mentions:</u>';
                }
                return desc;
            }

            d3.select('#cathead')
                .style('fill', color(1))
                .html(getFrequencyDescription(cat_name, info.cat25k, info.cat));
            d3.select('#notcathead')
                .style('fill', color(0))
                .html(getFrequencyDescription(ncat_name, info.ncat25k, info.ncat));
            console.log(info);
            if (jump) {
                if (window.location.hash == '#snippets') {
                    window.location.hash = '#snippetsalt';
                } else {
                    window.location.hash = '#snippets';
                }
            }
        }

        function showTooltip(d, pageX, pageY) {
            deselectLastCircle();
            var message = d.term + "<br/>" + d.cat25k + ":" + d.ncat25k + " per 25k words";
            if (!sortByDist) {
                message += '<br/>score: ' + d.os.toFixed(4);
            }
            tooltip.transition()
                .duration(0)
                .style("opacity", 1)
                .style("z-index", 10000000);
            tooltip.html(message)

                .style("top", (pageY - 28) + "px");

            tooltip.on('click', function () {
                tooltip.transition()
                    .style('opacity', 0)
            });
        }

            var searchTerm = document

                var aCatDist = a.x * a.x + (1 - a.y) * (1 - a.y);

                var bCatDist = b.x * b.x + (1 - b.y) * (1 - b.y);
                var bNotCatDist = b.y * b.y + (1 - b.x) * (1 - b.x);
                return (Math.min(aCatDist, aNotCatDist) > Math.min(bCatDist, bNotCatDist)) * 2 - 1;
            }

            function euclideanDistanceSortForCategory(a, b) {

                return (aCatDist > bCatDist) * 2 - 1;
            }

            function euclideanDistanceSortForNotCategory(a, b) {
                var aNotCatDist = a.y * a.y + (1 - a.x) * (1 - a.x);
                var bNotCatDist = b.y * b.y + (1 - b.x) * (1 - b.x);

                var bNotCatDist = b.y * b.y + (1 - b.x) * (1 - b.x);
                var aGood = aCatDist < aNotCatDist;
                var bGood = bCatDist < bNotCatDist;
                return {aGood: aGood, bGood: bGood};
            }

43c\u0435\u0442\u044f\u0442 \u043b\u0438 \u0432 \u0420\u043e\u0441\u0441\u0438\u0438 \u043e\u0442\u043c\u0435\u043d\u0443 \u0440\u044b\u0431\u043d\u043e\u0433\u043e \u044d\u043c\u0431\u0430\u0440\u0433\u043e?", "\u042f\u043a\u0443\u0442\u0441\u043a\u0438\u0439 \u043a\u0430\u0437\u0443\u0441: \u041f\u043e\u0447\u0435\u043c\u0443 \u0440\u0443\u0441\u0441\u043a\u0438\u0445 \u043b\u0438\u0448\u0438\u043b\u0438 \u0441\u0442\u0430\u0442\u0443\u0441\u0430 \"\u043a\u043e\u0440\u0435\u043d\u043d\u043e\u0433\u043e \u043d\u0430\u0440\u043e\u0434\u0430\"", "\u041f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 \u0420\u043e\u0441\u0441\u0438\u0438 \u0441\u043e\u043e\u0431\u0449\u0438\u043b \u043e \u0441\u0440\u043e\u043a\u0430\u0445 \u044d\u043d\u0435\u0440\u0433\u043e\u043e\u0431\u0435\u0441\u043f\u0435\u0447\u0435\u043d\u0438\u044f \u041a\u0440\u044b\u043c\u0430", "\u041f\u0443\u0442\u0438\u043d: \u041e\u0441\u043d\u043e\u0432\u043d\u044b\u0435 \u0432\u043e\u043f\u0440\u043e\u0441\u044b \u0438\u043d\u0442\u0435\u0433\u0440\u0430\u0446\u0438\u0438 \u041a\u0440\u044b\u043c\u0430 \u0440\u0435\u0448\u0435\u043d\u044b, \u0445\u043e\u0442\u044f \u043f\u0440\u043e\u0431\u043b\u0435\u043c \u0445\u0432\u0430\u0442\u0430\u0435\u0442", "\u041f\u0443\u0442\u0438\u043d \u0440\u0430\u0441\u0441\u043a\u0430\u0437\u0430\u043b, \u043a\u043e\u0433\u0434\u0430 \u0432 \u041a\u0440\u044b\u043c\u0443 \u0440\u0435\u0448\u0430\u0442 \u043f\u0440\u043e\u0431\u043b\u0435\u043c\u0443 \u0441 \u043f\u0440\u0435\u0441\u043d\u043e\u0439 \u0432\u043e\u0434\u043e\u0439", "\u0421\u0430\u043d\u043a\u0446\u0438\u0438 \u043f\u0440\u043e\u0442\u0438\u0432 \u0420\u043e\u0441\u0441\u0438\u0438 - \u043e\u0442\u0440\u0435\u0437\u0432\u043b\u0435\u043d\u0438\u0435 \u0431\u043b\u0438\u0437\u043a\u043e?", "\"\u0421\u043e\u0431\u0440\u0430\u043b \u043d\u0430\u0433\u043b\u043e\u0441\u0442\u044c \u0432 \u043a\u0443\u043b\u0430\u043a \u0438 \u043d\u0430\u0437\u0432\u0430\u043b\u0441\u044f \u043f\u0438\u0441\u0430\u0442\u0435\u043b\u0435\u043c\"", "\u041f\u0443\u0442\u0438\u043d \u043e \u0431\u043b\u043e\u043a\u0430\u0434\u0435 \u041a\u0440\u044b\u043c\u0430: \"\u0414\u0443\u043c\u0430\u043b\u0438, \u043d\u0430 \u043a\u043e\u043b\u0435\u043d\u0438 \u0432\u0441\u0442\u0430\u043d\u0435\u043c? \u0423\u0434\u0438\u0432\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0435 \u0438\u0434\u0438\u043e\u0442\u044b...\"", "\u041f\u043e\u0435\u0437\u0434 \u0421\u0430\u043f\u0441\u0430\u043d \u0437\u0430\u0434\u0435\u0440\u0436\u0430\u043b\u0441\u044f \u0432 \u043f\u0443\u0442\u0438 \u0438\u0437-\u0437\u0430 \u043f\u043e\u0433\u043e\u0434\u043d\u044b\u0445 \u0443\u0441\u043b\u043e\u0432\u0438\u0439", "\u0420\u043e\u0441\u0441\u0438\u044f \u043f\u0435\u0440\u0435\u0434\u0430\u043b\u0430 \u041d\u0438\u0434\u0435\u0440\u043b\u0430\u043d\u0434\u0430\u043c \u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b\u044b \u043f\u043e \u043a\u0440\u0443\u0448\u0435\u043d\u0438\u044e Boeing \u043d\u0430 \u0423\u043a\u0440\u0430\u0438\u043d\u0435", "\u0412 \u0420\u043e\u0441\u0441\u0438\u0438 \u043c\u043e\u0433\u0443\u0442 \u0432\u0432\u0435\u0441\u0442\u0438 \u043d\u0430\u043b\u043e\u0433 \u043d\u0430 \u0434\u0435\u043f\u043e\u0437\u0438\u0442\u044b?", "\u0412 \u0418\u0442\u0430\u043b\u0438\u0438 \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u043e \u0434\u0432\u0430 \u0437\u0435\u043c\u043b\u0435\u0442\u0440\u044f\u0441\u0435\u043d\u0438\u044f \u043f\u043e\u0434\u0440\u044f\u0434", "\u041e\u0431\u0441\u0442\u0440\u0435\u043b \u0448\u043a\u043e\u043b\u044b \u0432 \u0421\u0438\u0440\u0438\u0438: \u043f\u043e\u0433\u0438\u0431\u043b\u0438 22 \u0440\u0435\u0431\u0435\u043d\u043a\u0430 \u0438 6 \u0443\u0447\u0438\u0442\u0435\u043b\u0435\u0439", "Socialismo ou Barb\u00e1rie", "\u041c\u043e\u0441\u043a\u0432\u0430 \u0432\u0432\u0435\u043b\u0430 \u0432 \u044d\u043a\u0441\u043f\u043b\u0443\u0430\u0442\u0430\u0446\u0438\u044e \u0441\u0438\u0441\u0442\u0435\u043c\u0443 \u043f\u043e \u0431\u043e\u0440\u044c\u0431\u0435 \u0441 \u043f\u0440\u0435\u0432\u044b\u0448\u0435\u043d\u0438\u0435\u043c \u0441\u043a\u043e\u0440\u043e\u0441\u0442\u0438", "\u041d\u0430\u0431\u043b\u044e\u0434\u0430\u0442\u0435\u043b\u0438 \u041e\u0411\u0421\u0415 \u0432\u044b\u044f\u0432\u0438\u043b\u0438 \u0440\u044f\u0434 \u043d\u0430\u0440\u0443\u0448\u0435\u043d\u0438\u0439 \u043f\u0440\u0438 \u043f\u043e\u0434\u0433\u043e\u0442\u043e\u0432\u043a\u0435 \u043a \u0432\u044b\u0431\u043e\u0440\u0430\u043c \u0432 \u0421\u0428\u0410", "\u0414\u0436\u043e\u043d \u041a\u0435\u0440\u0440\u0438: \u0410\u043d\u0442\u0438\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0438\u0435 \u0441\u0430\u043d\u043a\u0446\u0438\u0438 \u0442\u043e\u043b\u044c\u043a\u043e \u0443\u043a\u0440\u0435\u043f\u0438\u043b\u0438 \u0421\u0428\u0410 \u0438 \u0415\u0432\u0440\u043e\u043f\u0443", "\u042e\u043d\u044b\u0439 \u0436\u0438\u0442\u0435\u043b\u044c \u0421\u0442\u0435\u0440\u043b\u0438\u0442\u0430\u043c\u0430\u043a\u0430 \u0441\u043f\u0430\u0441 \u0436\u0438\u0437\u043d\u044c \u0432\u044b\u043f\u0430\u0432\u0448\u0435\u0439 \u0438\u0437 \u043e\u043a\u043d\u0430 \u0434\u0435\u0432\u043e\u0447\u043a\u0435", "\u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440 \u0417\u0435\u043b\u044c\u0434\u0438\u043d \u0433\u043e\u0441\u043f\u0438\u0442\u0430\u043b\u0438\u0437\u0438\u0440\u043e\u0432\u0430\u043d \u0432 \u0442\u044f\u0436\u0435\u043b\u043e\u043c \u0441\u043e\u0441\u0442\u043e\u044f\u043d\u0438\u0438", "\u041c\u0438\u043d\u043e\u0431\u043e\u0440\u043e\u043d\u044b \u0420\u043e\u0441\u0441\u0438\u0438: \u042d\u0432\u0430\u043a\u0443\u0430\u0446\u0438\u044f \u0436\u0438\u0442\u0435\u043b\u0435\u0439 \u0410\u043b\u0435\u043f\u043f\u043e \u0431\u044b\u043b\u0430 \u0441\u043e\u0440\u0432\u0430\u043d\u0430 \u0431\u043e\u0435\u0432\u0438\u043a\u0430\u043c\u0438", "\u0422\u0438\u0433\u0440, \u0443\u0431\u0438\u0432\u0448\u0438\u0439 \u043a\u043e\u0440\u043e\u0432\u0443 \u0443 \u0444\u0435\u0440\u043c\u0435\u0440\u0430, \u043f\u043e\u0439\u043c\u0430\u043d \u043f\u043e\u0434 \u0412\u043b\u0430\u0434\u0438\u0432\u043e\u0441\u0442\u043e\u043a\u043e\u043c", "\u0428\u043a\u043e\u043b\u044b \u0432 \u0425\u0430\u0431\u0430\u0440\u043e\u0432\u0441\u043a\u0435 \"\u0437\u0430\u043c\u0438\u043d\u0438\u0440\u043e\u0432\u0430\u043b\" \u043f\u0435\u0440\u0432\u043e\u043a\u043b\u0430\u0441\u0441\u043d\u0438\u043a", "\u042d\u043a\u043e\u043b\u043e\u0433\u0438: \u0427\u0438\u0441\u043b\u043e \u043f\u043e\u0437\u0432\u043e\u043d\u043e\u0447\u043d\u044b\u0445 \u043d\u0430 \u043f\u043b\u0430\u043d\u0435\u0442\u0435 \u0441 1970 \u0433\u043e\u0434\u0430 \u0443\u043c\u0435\u043d\u044c\u0448\u0438\u043b\u043e\u0441\u044c \u0431\u043e\u043b\u0435\u0435 \u0447\u0435\u043c \u0432 \u0434\u0432\u0430 \u0440\u0430\u0437\u0430", "\u0424\u043b\u0435\u0448\u043a\u0438 \u0431\u0443\u0434\u0443\u0449\u0435\u0433\u043e: \u0423\u0447\u0435\u043d\u044b\u0435 \u043e\u0431\u044a\u044f\u0432\u0438\u043b\u0438 \u0430\u043b\u043c\u0430\u0437\u044b \u043b\u0443\u0447\u0448\u0438\u043c \u043d\u043e\u0441\u0438\u0442\u0435\u043b\u0435\u043c \u0438\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0438\u0438", "\u0412 \u0414\u0435\u043d\u044c \u043d\u0430\u0440\u043e\u0434\u043d\u043e\u0433\u043e \u0435\u0434\u0438\u043d\u0441\u0442\u0432\u0430 \u0432 \u041c\u043e\u0441\u043a\u0432\u0435 \u043f\u0440\u043e\u0439\u0434\u0435\u0442 \u043c\u0430\u0441\u0441\u043e\u0432\u0435 \u0448\u0435\u0441\u0442\u0432\u0438\u0435", "\u0412 \u0427\u0435\u0440\u043d\u043e\u043c \u043c\u043e\u0440\u0435 \u043d\u0430\u0448\u043b\u0438 \u043e\u0431\u043b\u043e\u043c\u043a\u0438 \u0431\u043e\u043b\u0435\u0435 40 \u0437\u0430\u0442\u043e\u043d\u0443\u0432\u0448\u0438\u0445 \u043a\u043e\u0440\u0430\u0431\u043b\u0435\u0439", "\u0414\u0432\u0435 \u0446\u0438\u0432\u0438\u043b\u0438\u0437\u0430\u0446\u0438\u0438: \u0411\u043e\u0440\u044c\u0431\u0430 \u043d\u0435 \u043d\u0430 \u0436\u0438\u0437\u043d\u044c, \u0430 \u043d\u0430 \u0441\u043c\u0435\u0440\u0442\u044c?", "57-\u043e\u0439 \u0433\u0443\u043c\u043a\u043e\u043d\u0432\u043e\u0439 \u0434\u043e\u0441\u0442\u0430\u0432\u0438\u043b \u0435\u0434\u0443 \u0438 \u043c\u0435\u0434\u0438\u043a\u0430\u043c\u0435\u043d\u0442\u044b \u0432 \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0438 \u0414\u043e\u043d\u0431\u0430\u0441\u0441\u0430", "\"\u0427\u0435\u043c \u0431\u043b\u0438\u0436\u0435 \u043c\u044b \u043a \u0432\u0437\u044f\u0442\u0438\u044e \u0410\u043b\u0435\u043f\u043f\u043e, \u0442\u0435\u043c \u044f\u0440\u043e\u0441\u0442\u043d\u0435\u0435 \u0420\u043e\u0441\u0441\u0438\u044e \u0431\u0443\u0434\u0443\u0442 \u043e\u0431\u0432\u0438\u043d\u044f\u0442\u044c\"", "\u041f\u0443\u0442\u0438\u043d \u0440\u0430\u0441\u0441\u043a\u0430\u0437\u0430\u043b \u043b\u0438\u043f\u0435\u0446\u043a\u043e\u0439 \u0444\u0430\u0431\u0440\u0438\u043a\u0435 \u041f\u043e\u0440\u043e\u0448\u0435\u043d\u043a\u043e", "\u041c\u0438\u043d\u043e\u0431\u043e\u0440\u043e\u043d\u044b \u0420\u0424: \u0412\u0438\u0434\u0435\u043e\u043a\u0430\u0434\u0440\u044b \u043f\u043e\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u0439 \u0443\u0434\u0430\u0440\u0430 \u043f\u043e \u0448\u043a\u043e\u043b\u0435 \u0432 \u0418\u0434\u043b\u0438\u0431\u0435 - \u043c\u043e\u043d\u0442\u0430\u0436", "\u0412\u0430\u0448\u0438\u043d\u0433\u0442\u043e\u043d \u043d\u0435 \u0432\u044b\u043f\u043e\u043b\u043d\u044f\u0435\u0442 \u0441\u0432\u043e\u0438\u0445 \u043e\u0431\u044f\u0437\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432 \u043f\u043e \u0431\u043e\u0440\u044c\u0431\u0435 \u0441 \"\u0414\u0436\u0435\u0431\u0445\u0430\u0442 \u0430\u043d-\u041d\u0443\u0441\u0440\u0430\"", "\u041f\u0443\u0442\u0438\u043d \u0432\u044b\u0441\u043a\u0430\u0437\u0430\u043b \u0432\u0441\u0435, \u0447\u0442\u043e \u043e\u043d \u0434\u0443\u043c\u0430\u0435\u0442 \u043e \u0422\u0440\u0430\u043c\u043f\u0435", "\u0423\u0447\u0435\u043d\u044b\u0435 \u0441\u0434\u0435\u043b\u0430\u043b\u0438 \u0430\u043a\u043a\u0443\u043c\u0443\u043b\u044f\u0442\u043e\u0440 \u043d\u043e\u0432\u043e\u0433\u043e \u043f\u043e\u043a\u043e\u043b\u0435\u043d\u0438\u044f \u043f\u043e\u0445\u043e\u0436\u0438\u043c \u043d\u0430 \u043a\u0438\u0448\u0435\u0447\u043d\u0438\u043a", "\u041a\u0443\u0440\u0434\u044b \u0440\u0430\u0437\u0440\u0443\u0431\u044f\u0442 \u0431\u043b\u0438\u0436\u043d\u0435\u0432\u043e\u0441\u0442\u043e\u0447\u043d\u044b\u0439 \u0443\u0437\u0435\u043b", "\u041f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 \u041f\u0443\u0442\u0438\u043d \u043e\u0442\u0432\u0435\u0442\u0438\u043b \u043d\u0430 \u043a\u0440\u0438\u0442\u0438\u043a\u0443 \u0417\u0430\u043f\u0430\u0434\u0430 \u043f\u043e \u043f\u043e\u0432\u043e\u0434\u0443 \u0410\u043b\u0435\u043f\u043f\u043e", "\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0438\u0439 \u0431\u0438\u043e\u043b\u043e\u0433 \u0441\u0442\u0430\u043b \u043f\u043e\u0431\u0435\u0434\u0438\u0442\u0435\u043b\u0435\u043c \u043a\u043e\u043d\u043a\u0443\u0440\u0441\u0430 Science, \"\u0441\u0442\u0430\u043d\u0446\u0435\u0432\u0430\u0432 \u0441\u0432\u043e\u044e \u0434\u0438\u0441\u0441\u0435\u0440\u0442\u0430\u0446\u0438\u044e\"", "\u0412\u044b\u043a\u0438\u043d\u0443\u0442\u044c \u0445\u043b\u0430\u043c \u0438 \u0436\u0438\u0442\u044c \u043f\u043e \u0444\u044d\u043d\u0448\u0443\u0439", "\u0414\u044b\u0440\u043a\u0430 \u043e\u0442 \u0440\u0443\u0431\u043b\u0438\u043a\u0430: \u0423\u043a\u0440\u0430\u0438\u043d\u0430 \u043d\u0435 \u043f\u043e\u043b\u0443\u0447\u0438\u0442 \u0448\u0442\u0440\u0430\u0444\u044b \u0441 \u0430\u0432\u0438\u0430\u043a\u043e\u043c\u043f\u0430\u043d\u0438\u0439 \u0420\u0424 \u0437\u0430 \u043f\u043e\u043b\u0435\u0442\u044b \u0432 \u041a\u0440\u044b\u043c", "\u0412 \u0415\u043a\u0430\u0442\u0435\u0440\u0438\u043d\u0431\u0443\u0440\u0433\u0435 \u043a\u043e\u043b\u043b\u0435\u043a\u0442\u043e\u0440\u044b \u0438\u0437\u0431\u0438\u043b\u0438 \u043f\u0435\u043d\u0441\u0438\u043e\u043d\u0435\u0440\u043a\u0443", "\u041f\u0443\u0442\u0438\u043d: \u0417\u0430\u043f\u0430\u0434 \u043f\u043e\u0441\u0442\u043e\u044f\u043d\u043d\u043e \u043d\u0430\u0441\u0442\u0443\u043f\u0430\u0435\u0442 \u043d\u0430 \u043e\u0434\u043d\u0438 \u0438 \u0442\u0435 \u0436\u0435 \u0433\u0440\u0430\u0431\u043b\u0438", "\u041c\u043e\u0441\u043a\u0432\u0430 \u0438 \u041c\u0430\u0434\u0440\u0438\u0434 \u0438\u0433\u0440\u0430\u044e\u0442 \u0441 \u041d\u0410\u0422\u041e \u0432 \u043d\u0435\u043f\u043e\u043d\u044f\u0442\u043a\u0438", "\u041a\u043e\u043c\u043f\u043b\u0435\u043a\u0441 \u041d\u043e\u0432\u043e\u0434\u0435\u0432\u0438\u0447\u044c\u0435\u0433\u043e \u043c\u043e\u043d\u0430\u0441\u0442\u044b\u0440\u044f \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e \u043e\u0431\u043d\u043e\u0432\u044f\u0442 \u043a 2023 \u0433\u043e\u0434\u0443", "\u0417\u0430\u0447\u0435\u043c \u0443\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u043e\u043c\u0443 \u043e\u043b\u0438\u0433\u0430\u0440\u0445\u0443 \u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0435 \u0433\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u0442\u0432\u043e?", "\u041f\u0443\u0442\u0438\u043d: \"\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0443\u0433\u0440\u043e\u0437\u0430\" - \u0433\u043b\u0443\u043f\u043e\u0441\u0442\u044c \u0438 \u0432\u044b\u043c\u044b\u0441\u0435\u043b", "\u041f\u0443\u0442\u0438\u043d: \u041d\u0435 \u0434\u0443\u043c\u0430\u044e, \u0447\u0442\u043e \u0430\u0433\u0440\u0435\u0441\u0441\u0438\u0432\u043d\u043e\u0441\u0442\u044c - \u043c\u043e\u0439 \u0441\u0442\u0438\u043b\u044c", "\u0412 \u043c\u0430\u0448\u0438\u043d\u0435 \u043f\u0440\u0435\u0434\u043f\u043e\u043b\u0430\u0433\u0430\u0435\u043c\u044b\u0445 \u0443\u0431\u0438\u0439\u0446 \u041d\u0435\u043c\u0446\u043e\u0432\u0430 \u043e\u0431\u043d\u0430\u0440\u0443\u0436\u0435\u043d\u044b \u0431\u0438\u043e\u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b\u044b", "\u0420\u043e\u0441\u0441\u0438\u044f \u0434\u043e\u043a\u0430\u0436\u0435\u0442 \u0432 \u041e\u041e\u041d, \u0447\u0442\u043e \u0434\u043e\u0433\u043e\u0432\u043e\u0440 \u043f\u043e \u0421\u0438\u0440\u0438\u0438 \u043d\u0435 \u0432\u044b\u043f\u043e\u043b\u043d\u044f\u044e\u0442 \u0421\u0428\u0410", "\u0412 \u041c\u0412\u0414 \u043e\u043f\u0440\u043e\u0432\u0435\u0440\u0433\u043b\u0438, \u0447\u0442\u043e \u0440\u0430\u0437\u044b\u0441\u043a\u0438\u0432\u0430\u044e\u0442 13-\u043b\u0435\u0442\u043d\u044e\u044e \u0434\u043e\u0447\u044c \u0421\u0435\u0440\u0434\u044e\u043a\u043e\u0432\u0430", "\u041a\u0430\u043d\u0430\u0434\u0430 \u0438 \u0415\u0421 \u043f\u043e\u0434\u043f\u0438\u0448\u0443\u0442 \u0441\u043e\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u0435 \u043e \u0441\u0432\u043e\u0431\u043e\u0434\u043d\u043e\u0439 \u0442\u043e\u0440\u0433\u043e\u0432\u043b\u0435", "\u041b\u0438\u0434\u0435\u0440 \u0438\u0440\u0430\u043a\u0441\u043a\u0438\u0445 \u043a\u0443\u0440\u0434\u043e\u0432 \u0440\u0430\u0441\u0441\u043a\u0430\u0437\u0430\u043b \u043e \u0441\u0440\u043e\u043a\u0430\u0445 \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u0438 \u0432 \u041c\u043e\u0441\u0443\u043b\u0435", "Apple \u0432\u044b\u043f\u0443\u0441\u0442\u0438\u0442 \u0442\u0440\u0438 \u0441\u0442\u0435\u043a\u043b\u044f\u043d\u043d\u044b\u0445 \"\u0430\u0439\u0444\u043e\u043d\u0430\"", "\u0421\u0428\u0410 \u043e\u0431\u0432\u0438\u043d\u0438\u043b\u0438 \u041a\u0438\u0442\u0430\u0439 \u0432 \u043a\u0440\u0430\u0436\u0435 \u0432\u043e\u0435\u043d\u043d\u044b\u0445 \u0441\u0435\u043a\u0440\u0435\u0442\u043e\u0432", "\u041a\u043e\u043c\u043f\u0430\u043d\u0438\u044f Alibaba \u043e\u0442\u043a\u0440\u044b\u043b\u0430 \u0432\u0430\u043a\u0430\u043d\u0441\u0438\u044e \u043a\u043e\u0442\u0430", "\u041f\u0440\u0438\u043c\u043e\u0440\u0441\u043a\u0438\u0435 \u0422\u041e\u0420 \u043c\u043e\u0433\u0443\u0442 \u043f\u043e\u043b\u0443\u0447\u0438\u0442\u044c 260 \u043c\u043b\u0440\u0434 \u0440\u0443\u0431. \u0438\u043d\u0432\u0435\u0441\u0442\u0438\u0446\u0438\u0439", "\u0421\u041c\u0418 \u0421\u0435\u0440\u0431\u0438\u0438 \u043f\u0440\u0438\u043f\u0438\u0441\u0430\u043b\u0438 \u0440\u043e\u0441\u0441\u0438\u044f\u043d\u0430\u043c \"\u043f\u043e\u0434\u0433\u043e\u0442\u043e\u0432\u043a\u0443 \u0442\u0435\u0440\u0430\u043a\u0442\u043e\u0432\" \u0432 \u0427\u0435\u0440\u043d\u043e\u0433\u043e\u0440\u0438\u0438", "\u0427\u0443\u0440\u043a\u0438\u043d: \u0421\u0428\u0410 \u043d\u0435 \u0432\u0437\u0430\u0438\u043c\u043e\u0434\u0435\u0439\u0441\u0442\u0432\u0443\u044e\u0442 \u0441 \u0420\u043e\u0441\u0441\u0438\u0435\u0439 \u0432 \u0431\u043e\u0440\u044c\u0431\u0435 \u0441 \"\u0414\u0436\u0435\u0431\u0445\u0430\u0442 \u0430\u043d-\u041d\u0443\u0441\u0440\u043e\u0439\"", "\u0421\u0435\u0440\u0431\u0441\u043a\u0430\u044f \u0433\u0430\u0437\u0435\u0442\u0430 \u0432\u044b\u0441\u043c\u0435\u044f\u043b\u0430 \u0443\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u043e\u0433\u043e \u043f\u043e\u0441\u043b\u0430-\u0433\u0440\u0430\u0444\u043e\u043c\u0430\u043d\u0430", "\u0412 \u0434\u0443\u0445\u0435 \u0432\u0440\u0435\u043c\u0435\u043d\u0438: \u041a\u0438\u0442\u0430\u0439 \u043e\u0431\u0437\u0430\u0432\u0435\u043b\u0441\u044f \u0432\u0442\u043e\u0440\u044b\u043c \u0430\u0432\u0438\u0430\u043d\u043e\u0441\u0446\u0435\u043c", "\u0427\u0438\u043d\u043e\u0432\u043d\u0438\u043a\u0438 \u043f\u0440\u0435\u0434\u043b\u0430\u0433\u0430\u044e\u0442 \u0432\u0432\u0435\u0441\u0442\u0438 \u0432 \u0420\u043e\u0441\u0441\u0438\u0438 \u043f\u043e\u0441\u043e\u0431\u0438\u0435 \u043f\u043e \u0431\u0435\u0434\u043d\u043e\u0441\u0442\u0438. \u0410 \u0434\u0440\u0443\u0433\u0438\u0435 - \u0443\u0431\u0440\u0430\u0442\u044c?", "\u0412 \u0420\u043e\u0441\u0441\u0438\u0438 \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0443\u0441\u043f\u0435\u0448\u043d\u043e \u0438\u0441\u043f\u044b\u0442\u0430\u043b\u0438 \u0433\u0438\u043f\u0435\u0440\u0437\u0432\u0443\u043a\u043e\u0432\u0443\u044e \u0440\u0430\u043a\u0435\u0442\u0443", "\u041f\u0440\u043e\u0432\u0430\u043b \u0437\u0430 \u043f\u0440\u043e\u0432\u0430\u043b\u043e\u043c: \u0412 \u0421\u0428\u0410 \u043f\u043e\u0445\u0438\u0442\u0438\u043b\u0438 \u0441\u043f\u0438\u0441\u043a\u0438 \u0448\u043f\u0438\u043e\u043d\u043e\u0432-\u043d\u0435\u043b\u0435\u0433\u0430\u043b\u043e\u0432", "\u0415\u0421 \u043d\u0430\u043c\u0435\u0440\u0435\u043d \u0440\u0430\u0441\u0448\u0438\u0440\u0438\u0442\u044c \u0441\u0430\u043d\u043a\u0446\u0438\u0438 \u0432 \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u0438 \u0421\u0438\u0440\u0438\u0438", "\u0410\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u043a\u0430, \u0437\u0430\u0431\u043e\u043b\u0435\u0432\u0448\u0430\u044f \u0440\u0430\u043a\u043e\u043c \u043e\u0442 \u043f\u0440\u0438\u0441\u044b\u043f\u043a\u0438 Johnson & Johnson, \u043e\u0442\u0441\u0443\u0434\u0438\u043b\u0430 $70 \u043c\u043b\u043d", "\"\u0414\u043b\u044f \u041f\u043e\u0440\u043e\u0448\u0435\u043d\u043a\u043e \u0433\u043b\u0430\u0432\u043d\u044b\u0435 \u0432\u0435\u0442\u0435\u0440\u0430\u043d\u044b \u0432\u043e\u0439\u043d\u044b \u2014 \u0431\u0430\u043d\u0434\u0435\u0440\u043e\u0432\u0446\u044b\"", "\"\u0413\u0440\u0430\u0436\u0434\u0430\u043d\u0430\u043c \u043c\u0438\u0440\u0430\" \u043d\u0443\u0436\u043d\u043e \u043d\u0435 \u041e\u0442\u0435\u0447\u0435\u0441\u0442\u0432\u043e, \u0430 \u0441\u043e\u0431\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0435 \u0441\u043f\u043e\u043a\u043e\u0439\u0441\u0442\u0432\u0438\u0435\"", "\u0421\u043e\u0440\u0430\u0442\u043d\u0438\u043a \u041f\u043e\u0440\u043e\u0448\u0435\u043d\u043a\u043e \u0432 \u0420\u0430\u0434\u0435 \u0437\u0430\u0434\u0435\u043a\u043b\u0430\u0440\u0438\u0440\u043e\u0432\u0430\u043b \u0445\u0440\u0430\u043c", "\u041a\u0430\u043a \u0437\u0430\u0442\u043a\u043d\u0443\u0442\u044c \"\u0447\u0435\u0440\u043d\u044b\u0435 \u0434\u044b\u0440\u044b\" \u0431\u044e\u0434\u0436\u0435\u0442\u043e\u0432", "\u0422\u0435\u043b\u0435\u043c\u0435\u0434\u0438\u0446\u0438\u043d\u0430 \u2014 \u043b\u0435\u0447\u0435\u0431\u043d\u044b\u0439 \u043f\u0440\u043e\u0440\u044b\u0432 \u0438\u043b\u0438 \u0444\u0438\u043a\u0446\u0438\u044f?", "\u0423\u043a\u0440\u0430\u0438\u043d\u0430 \u043f\u0443\u0433\u0430\u0435\u0442 \u0415\u0432\u0440\u043e\u043f\u0443 \"\u043f\u0440\u0438\u0437\u0440\u0430\u043a\u043e\u043c \u0420\u043e\u0441\u0441\u0438\u0438\"", "\u0410\u043a\u0430\u0434\u0435\u043c\u0438\u043a \u041c\u0430\u0442\u0438\u0448\u043e\u0432: \u0412 \u0410\u0440\u043a\u0442\u0438\u043a\u0435 \u043d\u0435 \u043c\u043e\u0436\u0435\u0442 \u0431\u044b\u0442\u044c \u0433\u0440\u0430\u043d\u0438\u0446", "\u0423\u0447\u0435\u043d\u044b\u0435 \u043f\u0440\u0438\u0431\u043b\u0438\u0437\u0438\u043b\u0438\u0441\u044c \u043a \u0440\u0430\u0437\u0433\u0430\u0434\u043a\u0435 \u0442\u0430\u0439\u043d\u044b \"\u0432\u0435\u0447\u043d\u043e\u0439 \u043c\u043e\u043b\u043e\u0434\u043e\u0441\u0442\u0438\"", "\u041e\u043f\u0440\u043e\u0441: \u0420\u043e\u0441\u0441\u0438\u044f\u043d\u0435 \u043e\u0434\u043e\u0431\u0440\u044f\u044e\u0442 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u0430 \u041f\u0443\u0442\u0438\u043d\u0430 \u0438 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430", "\u041e\u0442\u043a\u0443\u0434\u0430 \u0432 \u0427\u0435\u0440\u043d\u043e\u0433\u043e\u0440\u0438\u0438 \u0438 \u0421\u0435\u0440\u0431\u0438\u0438 \u0432\u0437\u044f\u043b\u0438\u0441\u044c \"\u0440\u0443\u0441\u0441\u043a\u0438\u0435 \u0430\u0433\u0435\u043d\u0442\u044b\"", "\u0414\u043e\u0447\u044c \u0421\u0435\u0440\u0434\u044e\u043a\u043e\u0432\u0430 \u043e\u0431\u044a\u044f\u0441\u043d\u0438\u043b\u0430 \u0441\u0432\u043e\u0435 \u0438\u0441\u0447\u0435\u0437\u043d\u043e\u0432\u0435\u043d\u0438\u0435", "\u0420\u043e\u0441\u0441\u0438\u044f \u043d\u0435 \u043f\u0443\u0441\u0442\u0438\u043b\u0430 \u0412\u0412\u0421 \u0422\u0443\u0440\u0446\u0438\u0438 \u0432 \u0432\u043e\u0437\u0434\u0443\u0448\u043d\u043e\u0435 \u043f\u0440\u043e\u0441\u0442\u0440\u0430\u043d\u0441\u0442\u0432\u043e \u0421\u0438\u0440\u0438\u0438", "\u0422\u0435\u0440\u043f\u0435\u043d\u0438\u0435 \u043a\u043e\u043d\u0447\u0438\u0442\u0441\u044f: \u0420\u043e\u0441\u0441\u0438\u044f \u043e\u0442\u0432\u0435\u0442\u0438\u0442 \u043d\u0430 \u043f\u0440\u043e\u0432\u043e\u043a\u0430\u0446\u0438\u0438 \u0421\u0428\u0410", "\"\u0412 \"\u0433\u0438\u043f\u0435\u0440\u0437\u0432\u0443\u043a\u0435\" \u0420\u043e\u0441\u0441\u0438\u044f \u043d\u0430 \u043f\u0435\u0440\u0435\u0434\u043e\u0432\u044b\u0445 \u043f\u043e\u0437\u0438\u0446\u0438\u044f\u0445, \u0443 \u0421\u0428\u0410 \u0442\u0430\u043a\u043e\u0433\u043e \u043f\u043e\u043a\u0430 \u043d\u0435\u0442\"", "\u0423\u0447\u0435\u043d\u044b\u0435 \u043f\u043e\u0434\u0433\u043e\u0442\u043e\u0432\u0438\u043b\u0438 \u043a \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0441\u0442\u0432\u0443 100-\u043f\u0440\u043e\u0446\u0435\u043d\u0442\u043d\u044b\u0439 \u043c\u0443\u0436\u0441\u043a\u043e\u0439 \u043a\u043e\u043d\u0442\u0440\u0430\u0446\u0435\u043f\u0442\u0438\u0432", "\u0414\u0435\u043b\u043e \u043a \u0432\u043e\u0439\u043d\u0435: \u0426\u0435\u0440\u043a\u0432\u0438 \u0438\u0449\u0443\u0442 \u043e\u0431\u0449\u0438\u0439 \u044f\u0437\u044b\u043a", "\u0413\u043b\u0430\u0432\u0430 \u0412\u0410\u041a \u043f\u0440\u0438\u0437\u0432\u0430\u043b \u0443\u043c\u0435\u0440\u0438\u0442\u044c \u043f\u044b\u043b \u0432\u043e\u043a\u0440\u0443\u0433 \u0434\u0438\u0441\u0441\u0435\u0440\u0442\u0430\u0446\u0438\u0438 \u041c\u0435\u0434\u0438\u043d\u0441\u043a\u043e\u0433\u043e", "\u041a\u0430\u043a \u0437\u0430\u0441\u0442\u0430\u0432\u0438\u0442\u044c \u0441\u0435\u0431\u044f \u0437\u0430\u043d\u0438\u043c\u0430\u0442\u044c\u0441\u044f \u0441\u043f\u043e\u0440\u0442\u043e\u043c? \u041e\u0442\u0432\u0435\u0442 \u043d\u0430\u0439\u0434\u0435\u043d", "\u0420\u043e\u0441\u043a\u043e\u0441\u043c\u043e\u0441 \u043f\u0440\u0438\u0433\u0440\u043e\u0437\u0438\u043b \u043f\u0440\u0435\u043a\u0440\u0430\u0442\u0438\u0442\u044c \u043f\u043e\u0441\u0442\u0430\u0432\u043a\u0438 \"\u0421\u043e\u044e\u0437\u043e\u0432\" \u0432\u043e \u0424\u0440\u0430\u043d\u04
